('FORMVIEW', 11, 337, 10, '파일 있을때', '//IO_FILE_YN = {F.IO_FILE_YN}	\nfunction {G.GRPID}_{F.FNCID}(token){	\n	alog(\"{G.GRPID}_{F.FNCID}---------------start\");\n\n	if( !( $(\"#{G.GRPID}-CTLCUD\").val() == \"C\" || $(\"#{G.GRPID}-CTLCUD\").val() == \"U\") ){\n		alert(\"신규 또는 수정 모드 진입 후 저장할 수 있습니다.\")\n		return;\n	}\n\n	//전송용 데이터 생성하기\n	var sendFormData = new FormData($(\"#formview{G.GRPID}\")[0]);\n\n	//컨디션 데이터 추가하기\n	conditionData = new FormData($(\"#condition\")[0]);\n	for(var pair of conditionData.entries()) {\n		sendFormData.append(pair[0],pair[1]);\n		//console.log(pair[0]+ \', \'+ pair[1]); \n	}\n\n\n	$.ajax({\n		type : \"POST\",\n		url : url_{G.GRPID}_{F.FNCID} + \"&TOKEN=\" + token,\n		data : sendFormData,\n		processData: false,\n		contentType: false,\n		success: function(tdata){\n			alog(tdata);\n			data = jQuery.parseJSON(tdata);\n			//alert(data);\n			if(data && data.RTN_CD == \"200\"){\n				msgNotice(\"정상적으로 저장되었습니다.\",1);\n			}else{\n				msgError(\"오류가 발생했습니다(\"+ data.ERR_CD + \").\" + data.RTN_MSG,3);\n			}\n		},\n		error: function(error){\n			alog(\"Error:\");\n			alog(error);\n		}\n	});\n}\n', '', '', '', 'R', 'F.IO_FILE_YN=Y', '', '20171218231844', '20180718083718'),
('FORMVIEW', 11, 338, 20, '파일 없을때', '//IO_FILE_YN = {F.IO_FILE_YN}	\nfunction {G.GRPID}_{F.FNCID}(token){	\n	alog(\"{G.GRPID}_{F.FNCID}---------------start\");\n\n	if( !( $(\"#{G.GRPID}-CTLCUD\").val() == \"C\" || $(\"#{G.GRPID}-CTLCUD\").val() == \"U\") ){\n		alert(\"신규 또는 수정 모드 진입 후 저장할 수 있습니다.\")\n		return;\n	}\n\n	//전송 데이터 객체 만들기\n	var sendFormData = new FormData($(\"#formview{G.GRPID}\")[0];);\n\n	//컨디션 데이터 추가하기\n	conditionData = new FormData($(\"#condition\")[0]);\n	for(var pair of conditionData.entries()) {\n		sendFormData.append(pair[0],pair[1]);\n		//console.log(pair[0]+ \', \'+ pair[1]); \n	}\n\n	$.ajax({\n		type : \"POST\",\n		url : url_{G.GRPID}_{F.FNCID} + \"&TOKEN=\" + token,\n		data : sendFormData,\n		processData: false,\n		contentType: false,\n		success: function(tdata){\n			alog(tdata);\n			data = jQuery.parseJSON(tdata);\n			//alert(data);\n			if(data && data.RTN_CD == \"200\"){\n				msgNotice(\"정상적으로 저장되었습니다.\",1);\n			}else{\n				msgError(\"오류가 발생했습니다(\"+ data.ERR_CD + \").\" + data.RTN_MSG,3);\n			}\n		},\n		error: function(error){\n			alog(\"Error:\");\n			alog(error);\n		}\n	});\n}\n', '', '', '', 'R', 'F.IO_FILE_YN=N', '', '20171218231844', '20180718083811'),
