('AJS', 418, 89, 0, '', '	//{G.GRPID}, {G.GRPNM}, {I.COLID}, {I.COLNM}\n	if( tGrpId ==\"{G.GRPID}\" && tColId == \"{I.COLID}\" ){\n		window.open(\"about:blank\",\"codeSearch{G.GRPID}Pop\",\"width={I.POP_WIDTH},height={I.POP_HEIGHT},resizable=yes,scrollbars=yes\");\n		\n		//값세팅하고\n		var frm1 = $(\'form[name=\"popupForm\"]\');\n\n		frm1.append(\"<input type=text name=\'{I.COLID}\' id=\'{I.COLID}\' value=\'\" + tValue + \"\'>\");//이 컬럼이 동적으로 {I.COLID} 변경되어야 함.	\n		frm1.append(\"<input type=text name=\'{I.COLID}-NM\' id=\'{I.COLID}-NM\' value=\'\" + tText + \"\'>\");//이 컬럼이 동적으로 {I.COLID} 변경되어야 함.	\n		\n		$(\"#GRPID\").val(tGrpId);\n		$(\"#ROWID\").val(tRowId);		\n		$(\"#COLID\").val(tColId);\n\n		//폼실행\n		var frm =document.popupForm;\n		frm.action = \"{I.POP_URL}\";//호출할 팝업 프로그램 URL\n		frm.target = \"codeSearch{G.GRPID}Pop\";\n		frm.method = \"post\";\n		//frm.submit();\n\n		alog(\"delay end and go.\");\n\n		//딜레이 폼실행\n		var timer;\n		var delay = 500; // 0.6 seconds delay after last input\n		window.clearTimeout(timer);\n		timer = window.setTimeout(function(){\n			alog(\"delay end and go1.\");\n			frm.submit();\n			alog(\"delay end and go2.\");\n		}, delay);\n	}\n', '', 'PGMIO', 'POPUP!=', 'L', '', '', '20180409140447', '20180409180058'),
('AJS', 421, 90, 10, 'GRID', '	//GRID\n	if(tGrpId == \"{G.GRPID}\" && tColId ==\"{I.COLID}\"){\n		alog(\"LAST_ROWID = \" + tRowId);\n		//그리드 일때\n		//전체 값중에 TEXT, VALUE만 변경\n		var origin = mygrid{G.GRPID}.cells(tRowId,mygrid{G.GRPID}.getColIndexById(tColId)).getValue();\n		alog(\"before = \" + origin);\n		var tArr = origin.split(\"^\"); ////CD^NM^GRPID\n		tArr[0] = tJsonObj.CD;\n		tArr[1] = tJsonObj.NM;	\n		tArr[2] = \"{G.GRPID}\";//GRPID\n		alog(\"after = \" + tArr[0] + \"^\" + tArr[1] + \"^\" + tArr[2]);\n\n		mygrid{G.GRPID}.cells(tRowId,mygrid{G.GRPID}.getColIndexById(tColId)).setValue(tArr[0] + \"^\" + tArr[1] + \"^\" + tArr[2] );\n	}\n	', '', 'PGMIO', 'POPUP!=', 'L', 'G.GRPTYPE=GRID', '', '20180409143529', '20180409181033'),
('AJS', 432, 93, 0, '', '	//{G.GRPID}, {G.GRPNM}, {I.COLID}, {I.COLNM}\n	if( tGrpId == \"{G.GRPID}\" && tColId == \"{G.GRPID}-{I.COLID}\" ){\n		window.open(\"about:blank\",\"codeSearch{G.GRPID}Pop\",\"width={I.POP_WIDTH},height={I.POP_HEIGHT},resizable=yes,scrollbars=yes\");\n		\n		//값세팅하고\n		var frm1 = $(\'form[name=\"popupForm\"]\');\n\n		frm1.append(\"<input type=text name=\'{I.COLID}\' id=\'{I.COLID}\' value=\'\" + tColId_Val + \"\'>\");//이 컬럼이 동적으로 {I.COLID} 변경되어야 함.	\n		frm1.append(\"<input type=text name=\'{I.COLID}-NM\' id=\'{I.COLID}-NM\' value=\'\" + tColId_Nm_Text + \"\'>\");//이 컬럼이 동적으로 {I.COLID} 변경되어야 함.		\n\n		$(\"#GRPID\").val(tGrpId);\n		$(\"#COLID\").val(tColId);\n\n		//폼실행\n		var frm =document.popupForm;\n		frm.action = \"{I.POP_URL}\";//호출할 팝업 프로그램 URL\n		frm.target = \"codeSearch{G.GRPID}Pop\";\n		frm.method = \"post\";\n		//frm.submit();\n\n		alog(\"delay end and go.\");\n\n		//딜레이 폼실행\n		var timer;\n		var delay = 500; // 0.6 seconds delay after last input\n		window.clearTimeout(timer);\n		timer = window.setTimeout(function(){\n			alog(\"delay end and go1.\");\n			frm.submit();\n			alog(\"delay end and go2.\");\n		}, delay);\n	}\n\n', '', 'PGMIO', 'POPUP!=', 'L', '', '', '20180409171122', '20180409172913'),
