INSERT INTO `CG_PGMSQL` (`SQLSEQ`, `PJTSEQ`, `PGMSEQ`, `SQLID`, `SQLNM`, `SVRSEQ`, `CRUD`, `RTN_TYPE`, `SQLORD`, `SQLTXT`, `ADDDT`, `MODDT`) VALUES
(1, 3, 20, 'sql1', 'PJT', 3, 'R', 'RTN_SELECT_LIST', 1, 'select\n	PJTSEQ,PJTID,PJTNM,FILECHARSET,UITOOL\n	,SVRLANG,DEPLOYKEY,PKGROOT,STARTDT,ENDDT\n	,DELYN,ADDDT,MODDT \nfrom\n CG_PJTINFO	\nwhere DELYN = \'N\'\n', '20141027183447', '20180530074236'),
(2, 3, 20, 'sql2', 'PJT', 3, 'D', 'RTN_INT', 2, 'update CG_PJTINFO set DELYN = \'Y\' where PJTSEQ = #{PJTSEQ} \n', '20141027183544', '20180123221631'),
(3, 3, 20, 'sql3', 'PJT', 3, 'U', 'RTN_INT', 3, 'update CG_PJTINFO set \nPJTID = #{PJTID}, PJTNM = #{PJTNM},FILECHARSET = #{FILECHARSET}, UITOOL = #{UITOOL}\n, SVRLANG = #{SVRLANG}, STARTDT = #{STARTDT}, ENDDT = #{ENDDT}\n, DEPLOYKEY = #{DEPLOYKEY}, PKGROOT = #{PKGROOT}\n, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\'), MODID = #{USER.SEQ}\nwhere PJTSEQ = #{PJTSEQ} \n\n', '20141027183908', '20180530074440'),
(4, 3, 20, 'sql4', 'PJT', 3, 'C', 'RTN_INT', 10, 'insert into CG_PJTINFO (\n	PJTID,PJTNM,FILECHARSET,UITOOL,SVRLANG\n	,DEPLOYKEY,PKGROOT,STARTDT,ENDDT\n	,ADDDT,ADDID\n) values (\n	#{PJTID},#{PJTNM},#{FILECHARSET},#{UITOOL},#{SVRLANG}\n	, #{DEPLOYKEY},#{PKGROOT},#{STARTDT},#{ENDDT}\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\'),#{USER.SEQ}\n	)\n	', '20141124200428', '20180530074416'),
(5, 3, 20, 'sql6', 'PGM', 3, 'R', 'RTN_SELECT_LIST', 30, 'select PJTSEQ,PGMSEQ,PGMID,PGMNM,VIEWURL,PGMTYPE,POPWIDTH,POPHEIGHT,SECTYPE,PKGGRP,LOGINYN,ADDDT,MODDT \nfrom\n CG_PGMINFO	\nwhere PJTSEQ = #{G3-PJTSEQ} \n ', '20141209203111', '20180904202818'),
(6, 3, 20, 'sql7', 'PGM', 3, 'C', 'RTN_INT', 10, 'insert into CG_PGMINFO(\n	 PJTSEQ, PGMID, PGMNM, PKGGRP, PGMTYPE\n	, POPWIDTH, POPHEIGHT, SECTYPE, LOGINYN\n	, ADDDT, ADDID\n) values (\n	 #{PJTSEQ},#{PGMID},#{PGMNM}, #{PKGGRP}, #{PGMTYPE}\n	, #{POPWIDTH}, #{POPHEIGHT}, #{SECTYPE}, #{LOGINYN}\n	 ,date_format(sysdate(),\'%Y%m%d%H%i%s\'),#{USER.SEQ}\n) \n', '20141209212623', '20180904202936'),
(7, 3, 20, 'sql8', 'PGM', 3, 'U', 'RTN_INT', 10, 'update\n CG_PGMINFO\nset \n PGMNM = #{PGMNM}, PGMID = #{PGMID}, PKGGRP = #{PKGGRP}, PGMTYPE = #{PGMTYPE}\n , POPWIDTH = #{POPWIDTH}, POPHEIGHT = #{POPHEIGHT}, SECTYPE = #{SECTYPE}, LOGINYN = #{LOGINYN}\n , MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\'), MODID = #{USER.SEQ}\nwhere PJTSEQ = #{PJTSEQ} and PGMSEQ = #{PGMSEQ} \n', '20141209212835', '20180904202948'),
(8, 3, 20, 'sql9', 'PGM', 3, 'D', 'RTN_INT', 10, 'delete from CG_PGMINFO\nwhere PJTSEQ = #{PJTSEQ} and PGMSEQ = #{PGMSEQ} \n', '20141209212956', '20180123221632'),
(9, 3, 20, 'sql10', 'DD', 3, 'R', 'RTN_SELECT_LIST', 1, 'select \n a.PJTSEQ, a.DDSEQ, a.COLID, a.COLNM, a.COLSNM\n ,a.DATATYPE, a.DATASIZE, a.OBJTYPE, b.OBJTYPE as OBJTYPE_FORMVIEW, c.OBJTYPE as OBJTYPE_GRID\n ,a.LBLWIDTH, a.LBLHEIGHT, a.LBLALIGN, a.OBJWIDTH, a.OBJHEIGHT, a.OBJALIGN\n ,a.CRYPTCD, a.VALIDSEQ, a.PIYN\n ,a.ADDDT, a.MODDT\nfrom CG_DD a\n	left outer join CG_DDOBJ b on a.DDSEQ = b.DDSEQ and b.GRPTYPE = \'FORMVIEW\'\n	left outer join CG_DDOBJ c on a.DDSEQ = c.DDSEQ and c.GRPTYPE = \'GRID\'\nwhere PJTSEQ = #{G3-PJTSEQ} \n', '20141209223245', '20180403074709'),
(10, 3, 20, 'sql11', 'DD', 3, 'C', 'RTN_INT', 20, 'insert into CG_DD (\n	PJTSEQ, COLID, COLNM, COLSNM, DATATYPE\n	, DATASIZE, OBJTYPE, LBLWIDTH, LBLHEIGHT, LBLALIGN,\n	, OBJWIDTH, OBJHEIGHT, OBJALIGN, CRYPTCD, VALIDSEQ\n	, PIYN\n	, ADDDT, ADDID\n) values (\n	#{PJTSEQ}, #{COLID}, #{COLNM}, #{COLSNM}, #{DATATYPE}\n	, #{DATASIZE}, #{OBJTYPE}, #{LBLWIDTH}, #{LBLHEIGHT}, #{LBLALIGN}\n	, #{OBJWIDTH}, #{OBJHEIGHT}, #{OBJALIGN}, #{CRYPTCD}, #{VALIDSEQ}, if(#{PIYN}=\'\',\'N\',#{PIYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n) \n', '20141209223546', '20180403074823'),
(11, 3, 20, 'sql12', 'DD', 3, 'U', 'RTN_INT', 20, 'update CG_DD\nset\n	COLID = #{COLID}, COLNM = #{COLNM}, COLSNM = #{COLSNM}, DATATYPE = #{DATATYPE}, DATASIZE = #{DATASIZE}\n	, OBJTYPE = #{OBJTYPE}, LBLWIDTH = #{LBLWIDTH}, LBLHEIGHT = #{LBLHEIGHT}, LBLALIGN = #{LBLALIGN}\n	, OBJWIDTH = #{OBJWIDTH}, OBJHEIGHT = #{OBJHEIGHT}, OBJALIGN = #{OBJALIGN}, CRYPTCD = #{CRYPTCD}, VALIDSEQ = #{VALIDSEQ}\n	, PIYN = #{PIYN}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\'), MODID = #{USER.SEQ}\nwhere PJTSEQ = #{PJTSEQ} and DDSEQ = #{DDSEQ}\n', '20141209223546', '20180403074823'),
(12, 3, 20, 'sql13', 'DD', 3, 'D', 'RTN_INT', 20, 'delete from CG_DD \nwhere PJTSEQ = #{PJTSEQ} and DDSEQ = #{DDSEQ} \n', '20141209223546', '20180123221632'),
(13, 3, 20, 'impR', 'CONFIG', 3, 'R', 'RTN_SELECT_ONE', 61, 'select \n PJTSEQ,CFGSEQ,USEYN,CFGID,CFGNM,MVCGBN,PATH,CFGORD,ADDDT,MODDT\nfrom CG_PJTCFG\nwhere PJTSEQ = #{G3-PJTSEQ} \n', '20150111154048', '20180323075704'),
(14, 3, 20, 'impC', 'CONFIG', 3, 'C', 'RTN_INT', 62, 'insert into CG_PJTCFG (\n PJTSEQ, CFGID, CFGNM, MVCGBN, PATH\n , CFGORD, USEYN\n , ADDDT, ADDID\n) values (\n #{PJTSEQ}, #{CFGID}, #{CFGNM}, #{MVCGBN}, #{PATH}\n , #{CFGORD}, #{USEYN}\n , date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n) \n', '20150111155539', '20180329195438'),
(15, 3, 20, 'impU', 'CONFIG', 3, 'U', 'RTN_INT', 63, 'update CG_PJTCFG set\n	CFGID = #{CFGID}, CFGNM = #{CFGNM}, MVCGBN = #{MVCGBN}, PATH = #{PATH}, USEYN = #{USEYN}\n	, CFGORD = #{CFGORD}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\'), MODID = #{USER.SEQ}\nwhere PJTSEQ = #{PJTSEQ} and CFGSEQ = #{CFGSEQ}\n', '20150111155539', '20180515213845'),
(16, 3, 20, 'impD', 'CONFIG', 3, 'D', 'RTN_INT', 64, 'delete from CG_PJTCFG\nwhere PJTSEQ = #{PJTSEQ} and CFGSEQ = #{CFGSEQ} \n', '20150111155539', '20180123221632'),
