(3, 20, 'HTMLJS', 2900, 258, '		mygridG3.attachEvent(\"onEditCell\", function(stage,rId,cInd,nValue,oValue){\n\n            alog(\"mygridG3  onEditCell ------------------start\");\n            alog(\"       stage : \" + stage);\n            alog(\"       rId : \" + rId);\n            alog(\"       cInd : \" + cInd);\n            alog(\"       nValue : \" + nValue);\n            alog(\"       oValue : \" + oValue);\n\n            RowEditStatus = mygridG3.getUserData(rId,\"!nativeeditor_status\");\n            if(stage == 2\n                && RowEditStatus != \"inserted\"\n                && RowEditStatus != \"deleted\"\n                && nValue != oValue\n                ){\n                if(RowEditStatus == \"\") {\n                    mygridG3.setUserData(rId,\"!nativeeditor_status\",\"updated\");\n                    mygridG3.setRowTextBold(rId);\n                }\n                mygridG3.cells(rId,cInd).cell.wasChanged = true;\n            }\n            return true;\n\n		});\n', '20180904203210', NULL),
