(24, 73, 'SVRDAO', 2858, 1, '<?php\n//DAO\n \nclass findfooterDao\n{\n	function __construct(){\n		alog(\"FindfooterDao-__construct\");\n	}\n	function __destruct(){\n		alog(\"FindfooterDao-__destruct\");\n	}\n	function __toString(){\n		alog(\"FindfooterDao-__toString\");\n	}\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 2, '', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 3, '	//TEAM    \n	public function sTeam($req){\n		//조회\n		$RtnVal = null;\n		$RtnVal[\"FNCTYPE\"] = \"R\";//CRUD \n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 4, '		$RtnVal[\"SVRID\"] = \"SC\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 5, '		$RtnVal[\"SQLTXT\"] = \"select uuid() as UUID_SEQ, c.TEAM_NM\n, sum( case when priority = 1 then 1 else 0 end ) as PRIORITY_1\n, sum( case when priority = 2 then 1 else 0 end ) as PRIORITY_2\n, sum( case when priority = 3 then 1 else 0 end ) as PRIORITY_3\n, count(b.LOADD_SEQ) as vul_cnt\nfrom \n	TEAMINFO c\n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 6, '		$RtnVal[\"BINDTYPE\"] = \"', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 7, '\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 8, '		return $RtnVal;\n    }  \n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 9, '	//SYS    \n	public function sSys($req){\n		//조회\n		$RtnVal = null;\n		$RtnVal[\"FNCTYPE\"] = \"R\";//CRUD \n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 10, '		$RtnVal[\"SVRID\"] = \"SC\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 11, '		$RtnVal[\"SQLTXT\"] = \"select UUID() as UUID_SEQ, TEAM_NM,SYS_NM, SUBSYS_NM, count(b.LOADD_SEQ) as VUL_CNT\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM  = #{G3-TEAM_NM}\ngroup by TEAM_NM, SYS_NM, SUBSYS_NM\norder by count(b.LOADD_SEQ) desc\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 12, '		$RtnVal[\"BINDTYPE\"] = \"', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 13, 's', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 14, '\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 15, '		return $RtnVal;\n    }  \n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 16, '	//RULESET    \n	public function sRule($req){\n		//조회\n		$RtnVal = null;\n		$RtnVal[\"FNCTYPE\"] = \"R\";//CRUD \n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 17, '		$RtnVal[\"SVRID\"] = \"SC\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 18, '		$RtnVal[\"SQLTXT\"] = \"select UUID() as UUID_SEQ, TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE as RULESET, count(b.LOADD_SEQ) as vul_cnt\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM = #{G4-TEAM_NM} and \n 	case \n		when #{G4-SUBSYS_NM} = \'\' then \n 			a.SUBSYS_NM  = \'\' or a.SUBSYS_NM is null\n		else a.SUBSYS_NM = #{G4-SUBSYS_NM}\n	end \n	and a.SYS_NM = #{G4-SYS_NM} \ngroup by TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE\norder by count(b.LOADD_SEQ) desc\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 19, '		$RtnVal[\"BINDTYPE\"] = \"', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 20, 's', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 21, 's', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 22, 's', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 23, 's', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 24, '\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 25, '		return $RtnVal;\n    }  \n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 26, '	//TEAM    \n	public function sTeamChart($req){\n		//조회\n		$RtnVal = null;\n		$RtnVal[\"FNCTYPE\"] = \"R\";//CRUD \n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 27, '		$RtnVal[\"SVRID\"] = \"SC\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 28, '		$RtnVal[\"SQLTXT\"] = \"select c.TEAM_NM, count(distinct b.type) as TYPE_CNT, ifnull(count(b.LOADD_SEQ),0) as VUL_CNT\nfrom \n	TEAMINFO c \n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere \ncase when #{G1-EX_TEAM_NM} <> \'\' then c.TEAM_NM <> #{G1-EX_TEAM_NM} \n	else\n		1=1\n	end\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 29, '		$RtnVal[\"BINDTYPE\"] = \"', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 30, 's', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 31, 's', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 32, '\";\n', '20180830084155', NULL),
(24, 73, 'SVRDAO', 2858, 33, '		return $RtnVal;\n    }  \n', '20180830084155', NULL),
