(24, 73, 'HTMLJS', 2862, 273, '		mygridG4.attachEvent(\"onEditCell\", function(stage,rId,cInd,nValue,oValue){\n\n            alog(\"mygridG4  onEditCell ------------------start\");\n            alog(\"       stage : \" + stage);\n            alog(\"       rId : \" + rId);\n            alog(\"       cInd : \" + cInd);\n            alog(\"       nValue : \" + nValue);\n            alog(\"       oValue : \" + oValue);\n\n            RowEditStatus = mygridG4.getUserData(rId,\"!nativeeditor_status\");\n            if(stage == 2\n                && RowEditStatus != \"inserted\"\n                && RowEditStatus != \"deleted\"\n                && nValue != oValue\n                ){\n                if(RowEditStatus == \"\") {\n                    mygridG4.setUserData(rId,\"!nativeeditor_status\",\"updated\");\n                    mygridG4.setRowTextBold(rId);\n                }\n                mygridG4.cells(rId,cInd).cell.wasChanged = true;\n            }\n            return true;\n\n		});\n', '20180830084250', NULL),
