(24, 73, 'SVRDAO', 2879, 3, '	//TEAM    \n	public function sTeam($req){\n		//조회\n		$RtnVal = null;\n		$RtnVal[\"FNCTYPE\"] = \"R\";//CRUD \n', '20180904201526', NULL),
(24, 73, 'SVRDAO', 2879, 4, '		$RtnVal[\"SVRID\"] = \"SC\";\n', '20180904201526', NULL),
(24, 73, 'SVRDAO', 2879, 5, '		$RtnVal[\"SQLTXT\"] = \"select uuid() as UUID_SEQ, c.TEAM_NM\n, sum( case when priority = 1 then 1 else 0 end ) as PRIORITY_1\n, sum( case when priority = 2 then 1 else 0 end ) as PRIORITY_2\n, sum( case when priority = 3 then 1 else 0 end ) as PRIORITY_3\n, count(b.LOADD_SEQ) as vul_cnt\nfrom \n	TEAMINFO c\n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc\";\n', '20180904201526', NULL),
(24, 73, 'SVRDAO', 2879, 6, '		$RtnVal[\"BINDTYPE\"] = \"', '20180904201526', NULL),
(24, 73, 'SVRDAO', 2879, 7, '\";\n', '20180904201526', NULL),
(24, 73, 'SVRDAO', 2879, 8, '		return $RtnVal;\n    }  \n', '20180904201526', NULL),
(24, 73, 'SVRDAO', 2879, 9, '	//SYS    \n	public function sSys($req){\n		//조회\n		$RtnVal = null;\n		$RtnVal[\"FNCTYPE\"] = \"R\";//CRUD \n', '20180904201526', NULL),
