(24, 73, 'SVRDAO', 2879, 11, '		$RtnVal[\"SQLTXT\"] = \"select UUID() as UUID_SEQ, TEAM_NM,SYS_NM, SUBSYS_NM, count(b.LOADD_SEQ) as VUL_CNT\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM  = #{G3-TEAM_NM}\ngroup by TEAM_NM, SYS_NM, SUBSYS_NM\norder by count(b.LOADD_SEQ) desc\";\n', '20180904201526', NULL),
