(24, 73, 'SVRDAO', 2879, 16, '	//RULESET    \n	public function sRule($req){\n		//조회\n		$RtnVal = null;\n		$RtnVal[\"FNCTYPE\"] = \"R\";//CRUD \n', '20180904201526', NULL),
(24, 73, 'SVRDAO', 2879, 17, '		$RtnVal[\"SVRID\"] = \"SC\";\n', '20180904201526', NULL),
(24, 73, 'SVRDAO', 2879, 18, '		$RtnVal[\"SQLTXT\"] = \"select UUID() as UUID_SEQ, TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE as RULESET, count(b.LOADD_SEQ) as vul_cnt\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM = #{G4-TEAM_NM} and \n 	case \n		when #{G4-SUBSYS_NM} = \'\' then \n 			a.SUBSYS_NM  = \'\' or a.SUBSYS_NM is null\n		else a.SUBSYS_NM = #{G4-SUBSYS_NM}\n	end \n	and a.SYS_NM = #{G4-SYS_NM} \ngroup by TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE\norder by count(b.LOADD_SEQ) desc\";\n', '20180904201526', NULL),
(24, 73, 'SVRDAO', 2879, 19, '		$RtnVal[\"BINDTYPE\"] = \"', '20180904201526', NULL),
