(24, 73, 'HTMLJS', 2882, 369, '		mygridG5.attachEvent(\"onEditCell\", function(stage,rId,cInd,nValue,oValue){\n\n            alog(\"mygridG5  onEditCell ------------------start\");\n            alog(\"       stage : \" + stage);\n            alog(\"       rId : \" + rId);\n            alog(\"       cInd : \" + cInd);\n            alog(\"       nValue : \" + nValue);\n            alog(\"       oValue : \" + oValue);\n\n            RowEditStatus = mygridG5.getUserData(rId,\"!nativeeditor_status\");\n            if(stage == 2\n                && RowEditStatus != \"inserted\"\n                && RowEditStatus != \"deleted\"\n                && nValue != oValue\n                ){\n                if(RowEditStatus == \"\") {\n                    mygridG5.setUserData(rId,\"!nativeeditor_status\",\"updated\");\n                    mygridG5.setRowTextBold(rId);\n                }\n                mygridG5.cells(rId,cInd).cell.wasChanged = true;\n            }\n            return true;\n\n		});\n', '20180904201617', NULL),
